function CharacterList(props) {

    const userCharacters = props.character.map((character) => {
        return (
            <li>
                <a href="#">
                    <img
                        className=""
                        src={character.image}
                        alt={`foto de ${character.name}`}
                        title={`foto de ${character.name}`}></img>
                    <h4 className="">{character.name}</h4>
                    <p className="">{character.species}</p>

                </a>
            </li>

        );
    });

    return (
        <section>
            <ul className="">
                {userCharacters}

            </ul>
        </section>
    )
};
export default CharacterList;
